ss\");	//\n	}else{//\n		$(\'#rpassword\').validate_callback(\"\",\"failed\");	//APIpwd2 TIP\n		return false;\n	}\n	\n\n	\n	\n}\n      </script>\n  </head>\n  \n  <body>\n\n<!---->\n<#include \"/WEB-INF/theme/default/shop/header.ftl\">\n\n\n<div id=\"main\">\n	<div class=\"content mt5\">\n	   <div class=\"register\">\n	   <div class=\"top\"><span id=\"activeemailmsg\"></span></div>\n	   <form id=\"myform_register\" name=\"register\" action=\"register.action\" method=\"post\">\n				<div class=\"registerbox\">\n					<div class=\"reg_list1\">\n			        	<div class=\"reg_div1 \">\n			        		<p><code>*</code> Email</p>\n			        		<cite><input onfocus=\"clearMsg(3)\" type=\"text\" id=\"email\" name=\"email\" reg=\"^\\w+([-+.]\\w+)*@\\w+([-.]\\w+)*\\.\\w+([-.]\\w+)*$\" tip=\"ostocy@sina.com\" ></cite>\n			        		<div id=\"EmailMsg\"></div>\n			        	</div>\n			        	<div class=\"reg_div1\">\n			        		<p><code>*</code> </p>\n			        		<cite><input onfocus=\"clearMsg(1)\" type=\"text\" id=\"username\" name=\"username\" reg=\"^\\w{6,20}$\" tip=\"6-20_\"></cite>\n			        		<div id=\"usernameMsg\"></div>\n			        	</div>\n			        	<div class=\"reg_div1\">\n			        		<p><code>*</code> </p>\n			        		<cite><input onfocus=\"clearMsg(2)\" type=\"password\" name=\"password\" id=\"password\" reg=\"^\\w{6,16}$\" tip=\"6-16\">\n			        		</cite><div id=\"passwordMsg\"></div>\n			        	</div>\n			        	<div class=\"reg_div1\"><p><code>*</code> </p><cite><input type=\"password\" onkeypress=\"clearMsg(this);\" onblur=\"checkPwd2(this);\" id=\"rpassword\" name=\"rpassword\"></cite><div id=\"password2Msg\" class=\"accept\"></div></div>\n			        	<div class=\"reg_div2\">\n			        		<p><code>*</code> </p>\n			        		<cite><input onfocus=\"clearMsg(2)\" style=\"width:74px;\" name=\"rand\" id=\"rand\"></cite>\n			        		<em><img id=\"random\" src=\"rand.action\" onclick=\"changeValidateCode(this)\"/>\n			        		</em>\n			        		<