 ('201111150025','WEB-INF/theme/default/shop/goodscategorylist.ftl','','goodscategorylist','2012-08-24 16:22:56','20100721001','1','20120203001','default','\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Strict//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd\">\n<html>\n  <head>\n     <title>${(goodscategory.name)}----Powered By OSTOCY</title>\n	<meta name=\"Author\" content=\"OSTOCY\">\n	<meta name=\"Copyright\" content=\"OSTOCY\">\n	<meta http-equiv=\"expires\" content=\"0\">    \n	<#if (jshopbasicinfo.metaKeywords)! != \"\"><meta name=\"keywords\" content=\"${jshopbasicinfo.metaKeywords}\"/></#if>\n	<#if (jshopbasicinfo.metaDes)! != \"\"><meta name=\"description\" content=\"${jshopbasicinfo.metaDes}\"/></#if>\n	<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\n	<link rel=\"stylesheet\" type=\"text/css\" href=\"${basepath}/ui/default/css/global.css\" />\n	<link rel=\"stylesheet\" type=\"text/css\" href=\"${basepath}/ui/default/css/list.css\" />\n	<script type=\"text/javascript\"  src=\"${basepath}/ui/default/js/jquery-1.6.2.min.js\"></script>\n  </head>\n  \n  <body>\n\n<!---->\n<#include \"/WEB-INF/theme/default/shop/header.ftl\">\n\n<!---->\n<input type=\"hidden\" id=\"hidurl\" name=\"hidurl\" value=\"\"/>\n<input type=\"hidden\" id=\"hidsign\" name=\"hidsign\" value=\"${goodscategory.sign}\"/>\n<div id=\"main\">\n  <div class=\"content2 mt5\">\n    <div id=\"mainleft\">\n      <div class=\"sortnav\">\n		<#if (secondgoodscategory??)&&(secondgoodscategory?size>0)>\n        <div class=\"sortnav_t\"><a target=\"_blank\" href=\"#\"></a></div>\n        <ul>\n		  <#list secondgoodscategory as sct>\n		  <#if sct.htmlpath! !=\"\">\n		  <li><a href=\"${basepath}/<@sct.htmlpath?interpret />\">${sct.name}</a></li>\n          \n		  </#if>\n		  </#list>\n		</ul>\n		</#if>\n      </div>\n      <div class=\"sortnav_b\">\n        <p><img src=\"${basepath}/ui/default/images/sortnav7.gif\" /></p>\n        <cite><img src=\"${basepath}/ui/default/images/sortnav9.gif\" /></cite></div>\n     \n    </div>\n    <!--  -->\n    <div id=\"mainright\">\n      <div class=\"classify\">\n        <h1>\n          <p></p>\n          <cite></cite> </h1>\n        <div class=\"classify_box\">\n          <ul>\n		    <#if (goodstypebrandt??)&&(goodstypebrandt?size>0)>\n            <li>\n              <p></p>\n              <span>\n			  <a class=\"curr\" href=\"#\"></a>\n			  <#list goodstypebrandt as gtbt>\n			    <a href=\"#?brandid=${gtbt.brandid}\">${gtbt.brandname}</a> \n			  </#list>\n			  </span>\n			</li>\n			</#if>\n			<#if (goodsattrs??)&&(goodsattrs?size>0)>\n            <#list goodsattrs as ga>\n			<li>\n              <p>${ga.goodsattributename}</p>\n              <span> <a class=\"curr\" href=\"#\"></a>\n			  <#list ga.attributelist?split(\",\") as attr>\n			  <a href=\"#?attrs=${attr}\">${attr}</a>\n			  </#list>\n			  </span>\n			</li>\n			</#list>\n			</#if>\n          </ul>\n          <!--  -->\n        </div>\n        <div class=\"classifyfoot\">\n          <p></p>\n          <cite></cite></div>\n      </div>\n      <div class=\"productlist mt10\">\n        <h1>\n          <div class=\"productlist_l1\"><span>${goods.totalRecord}</span> <span>${goods.bottomPages}</span></div>\n          <div class=\"productlist_r1\">\n            <div class=\"mode\">\n              <!--<p></p>\n              <span><a href=\"/ProductList.do?displayType=1&amp;pageSize=24&amp;Cid=51302&amp;Keywords=&amp;ppath=ZiwscHVzaHR5cGUwLCwvLCwxLCw7O2MsLGNpZCws56yU6K6w5pysLCw1MTMwMiws\"><img src=\"${basepath}/ui/default/images/listbtn2.gif\" /></a></span> <span><a href=\"/ProductList.do?displayType=2&amp;pageSize=10&amp;Cid=51302&amp;Keywords=&amp;ppath=ZiwscHVzaHR5cGUwLCwvLCwxLCw7O2MsLGNpZCws56yU6K6w5pysLCw1MTMwMiws\"><img src=\"${basepath}/ui/default/images/listbtn1a.gif\" /></a></span>\n				-->\n			</div>\n            <div class=\"plmiddle\">|</div>\n            <div class=\"position\"><code></code>\n			<a class=\"positionbtn1\" id=\"hotsale\" name=\"hotsale\" href=\"#\"></a>\n              <div style=\"float:left\"> <a class=\"positionbtn1\" href=\"#\"></a>\n                <div style=\"display: none; z-index: 100;\" id=\"listPriceSort\" class=\"position2\">\n                  <!--<div><a href=\"/ProductList.do?OrderBy=price0-string&amp;IsAsc=false&amp;displayType=1&amp;Keywords=&amp;ppath=ZiwscHVzaHR5cGUwLCwvLCwxLCw7O2MsLGNpZCws56yU6K6w5pysLCw1MTMwMiws&amp;Cid=51302\">-</a></div>\n                  <div><a href=\"/ProductList.do?OrderBy=price0-string&amp;IsAsc=true&amp;displayType=1&amp;Keywords=&amp;ppath=ZiwscHVzaHR5cGUwLCwvLCwxLCw7O2MsLGNpZCws56yU6K6w5pysLCw1MTMwMiws&amp;Cid=51302\">-</a></div>\n					-->\n				</div>\n              </div>\n              <a class=\"positionbtn21\" href=\"#\"></a> </div>\n          </div>\n        </h1>\n\n        <form style=\"margin:0px;\" id=\"plist\" name=\"plist\">\n          <ul>\n			<#if (goods.getList()??)&&(goods.getList()?size>0)>\n			<#list goods.getList() as g>\n            <li>\n              <div class=\"pd1\">\n                <div style=\"position:relative;\">\n				<a target=\"_blank\" href=\"${basepath}/<@g.htmlPath?interpret />\">\n				<#list g.pictureurl?split(\",\") as img>\n				<#if img_index=0>\n				<img border=\"0\" alt=\"${g.goodsname}\" style=\"width:120px;height:120px;\" src=\"${basepath}${img}\" id=\"imgbox_${g.goodsid}\" />\n				</#if>\n				</#list>\n				</a>\n                  <!---->\n                  <div class=\"iconQg\">\n				  <#if g.recommended=\"1\">\n				  <img border=\"0\" src=\"${basepath}/ui/default/images/promotion_6.png\" />\n				  <#elseif g.hotsale=\"1\">\n				  <img border=\"0\" src=\"${basepath}/ui/default/images/promotion_6.png\" />\n				  <#elseif g.bargainprice=\"1\">\n				  <img border=\"0\" src=\"${basepath}/ui/default/images/promotion_6.png\" />\n				  <#elseif g.isNew=\"1\">\n				  <img border=\"0\" src=\"${basepath}/ui/default/images/promotion_6.png\" />\n				  <#else>\n				  <img border=\"0\" src=\"${basepath}/ui/default/images/promotion_6.png\" />\n				  </#if>\n				  </div>\n                  <!---->\n                </div>\n              </div>\n              <div class=\"pd2\"> <a title=\"${g.goodsname}\" target=\"_blank\" href=\"${basepath}/<@g.htmlPath?interpret />\"> ${g.goodsname}</a> </div>\n              <div class=\"pd4\"> <span>${g.memberprice}</span> </div>\n              <div class=\"pd5\"> \n			  <a onclick=\"addtocart(${g.goodsid})\" id=\"addtocart${g.goodsid}\" name=\"addtocart${g.goodsid}\" class=\"list_buy\" href=\"javascript:;\"></a>\n			  \n			  <a onclick=\"addtofav(\'${g.goodsid}\',\'${g.goodsname}\',\'${g.readcount}\',\'${g.memberprice}\')\"  id=\"addtofav${g.goodsid}\" name=\"addtofav${g.goodsid}\" class=\"list_fav\" href=\"javascript:;\"></a>\n			  \n                <input type=\"checkbox\" style=\"display:none;\" value=\"${g.goodsid}\" name=\"compare\" id=\"compare${g.goodsid}\" />\n              </div>\n            </li>\n			</#list>\n			<#else>\n				<div id=\"errorinfo\">\n				\n				</div>\n            </#if>\n			\n          </ul>\n        </form>\n        <div class=\"clear\"></div>\n        <div class=\"listbottom\">\n          	<!--  -->\n				\n				 <#include \"/WEB-INF/theme/default/shop/splitpage.ftl\">\n				\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n\n<#include \"/WEB-INF/theme/default/shop/footer.ftl\">\n	<script type=\"text/javascript\" src=\"${basepath}/ui/default/js/jshop.js\"></script>\n</body>\n</html>\n','default_goodscategorylist','1'),
 ('201111180026','WEB-INF/theme/default/shop/splitpage.ftl','','splitpage','2012-04-22 19:05:09','20100721001','1','20120203001','default','<#macro isDisabled comparePage>\n    <#if \"${comparePage}\"  == \"${goods.pageNo}\"><#t>\n        disabled=\"disabled\" href=\"#\"<#t>\n    <#else>\n        href=\"${sign}_${comparePage}.html\"<#t>\n    </#if>\n</#macro>\n\n<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01 Transitional//EN\" \"http://www.w3.org/TR/html4/loose.dtd\">\n<html>\n<style type=\"text/css\">\n	.button_myway3{\n	background:#ffffff;\n    border: 1px solid #fb7510;\n    color: #000;\n    font-size: 12px;\n    font-weight: lighter;\n    height: 20px;\n	}\n		.button_myway4{\n	background:#ffffff;\n    border: 1px solid #fb7510;\n    color: #000;\n    font-size: 12px;\n    font-weight: lighter;\n    height: 20px;\n    width:20px;\n	}\n</style>\n <body>\n <center>\n<a <@isDisabled comparePage=\"1\" />></a> <#t>\n<a <@isDisabled comparePage=\"${goods.previousPageNo}\" />></a> <#t>\n<a <@isDisabled comparePage=\"${goods.nextPageNo}\" />></a> <#t>\n<a <@isDisabled comparePage=\"${goods.bottomPages}\" />></a> <#t>\n${goods.pageNo}/${goods.bottomPages} <#t>\n${goods.totalRecord}\n\n\n </body>\n</html>','default_splitpage','1'),
