olor=\"red\"></font></a>										\n						<br/>\n						</#if>\n						\n						<#if (uo.paystate==\'0\')>\n						<!--InitPayPage.action InitMyOrdersDetail-->\n							<a href=\"InitPayPage.action?redirecturl=findAllUserOrderOn.action?&orderid=${uo.orderid}\"><font color=\"red\"></font></a><br/>\n							<a href=\"InitMyOrdersDetail.action?orderid=${uo.orderid}\" target=\"_blank\"></a><br/>\n							<a href=\"${uo.logisticswebaddress}\" target=\"_blank\"></a><br/>\n						</#if>\n						</td>\n					</tr>\n					</#list>\n				</#if>\n			</tbody>\n		</table>\n      </div>\n    </div>\n	\n    <div class=\"m2top\"><span></span></div>\n    <div class=\"m3\">\n	<#if (shufflerecommendgoods??)&&(shufflerecommendgoods?size>0)>\n		<#list shufflerecommendgoods as scg>\n		<div class=\"each1\">\n			<div class=\"img\"><a href=\"${basepath}/<@scg.htmlPath?interpret />\" target=\"_blank\">\n			<#list scg.pictureurl?split(\",\") as img>\n			<#if img_index==0>\n			<img style=\"width:120px;height:120px;\" src=\"${basepath}/${img}\" alt=\"${scg.goodsname}\">\n			</#if>\n			</#list>\n			</a>\n			</div>\n			<div class=\"name\"><a href=\"${basepath}/<@scg.htmlPath?interpret />\" target=\"_blank\" title=\"${scg.goodsname}\">${scg.goodsname}</a></div>\n			<div id=\"commend${scg.goodsid}\">\n			  <div class=\"price2\"><span>${scg.memberprice}</span></div>\n			</div>\n		</div>\n		</#list>\n	</#if>\n    </div>\n  </div>\n</div>\n</div>\n<div id=\"dtmem_bot\" class=\"dtmem_bot_ind\"></div>\n</div>\n</div>\n\n<#include \"/WEB-INF/theme/default/shop/footer.ftl\">\n<script type=\"text/javascript\" src=\"${basepath}/ui/default/js/jshop.js\"></script>\n</body>\n</html>','default_myorder','1'),
 ('201201120041','WEB-INF/theme/default/shop/pager.ftl','','pager','2012-07-17 13:56:43','20100721001','1','20120203001','default','<#macro isDisabled comparePage>\n    <#if \"${comparePage}\"  == \"${goods.pageNo}\"><#t>\n        disabled=\"disabled\" href=\"#\"<#t>\n    <#else>\n        href=\"searchGoodsByGoodsName.action?topKeywords=${topKeywords}&page=${comparePage}\"<#t>\n    </#if>\n</#macro>\n\n<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01 Transitional//EN\" \"http://www.w3.org/TR/html4/loose.dtd\">\n<html>\n<style type=\"text/css\">\n	.button_myway3{\n	background:#ffffff;\n    border: 1px solid #fb7510;\n    color: #000;\n    font-size: 12px;\n    font-weight: lighter;\n    height: 20px;\n	}\n		.button_myway4{\n	background:#ffffff;\n    border: 1px solid #fb7510;\n    color: #000;\n    font-size: 12px;\n    font-weight: lighter;\n    height: 20px;\n    width:20px;\n	}\n</style>\n <body>\n <center>\n<a <@isDisabled comparePage=\"1\" />></a> <#t>\n<a <@isDisabled comparePage=\"${goods.previousPageNo}\" />></a> <#t>\n<a <@isDisabled comparePage=\"${goods.nextPageNo}\" />></a> <#t>\n<a <@isDisabled comparePage=\"${goods.bottomPages}\" />></a> <#t>\n${goods.pageNo}/${totalpage} <#t>\n${totalgoods}\n\n\n </body>\n</html>','default_pager','1');
