a target=\"_blank\" title=\"${mog.goodsname}\" href=\"{basepath}html/default/shop/${mog.goodsid}.html\">${mog.goodsname}</a>\n												</span>\n											</div>\n										</div>\n									</td>\n									<td>${mog.usersetnum}</td>\n									\n									<td colspan=\"1\">${mog.favorable}</td>\n									<td colspan=\"1\">${mog.points}</td>\n									<td colspan=\"1\">${mog.needquantity}</td>\n									<td colspan=\"1\">${mog.weight}</td>\n									<td colspan=\"1\">${myorder.myorderdetail.freight}</td>\n								\n								</tr>\n								</#list>\n								</#if>\n								<tr class=\"order-item\">\n									<td colspan=\"7\"></td>\n									<td colspan=\"1\"><span>${myorder.myorderdetail.shouldpay}</span></td>\n								\n								</tr>\n							</tbody>\n							<tbody class=\"contact-info\">\n								<tr class=\"sep-row\"><td colspan=\"8\"></td></tr>\n								<tr>\n									<th colspan=\"1\"><h4></h4></th>\n								</tr>\n								\n								<tr>\n									<td colspan=\"7\"><span>${myorder.myshipping.province},${myorder.myshipping.city},${myorder.myshipping.district},${myorder.myshipping.street},${myorder.myshipping.postcode},${myorder.myshipping.mobile},${myorder.myshipping.telno},</span></td>\n									\n								</tr>\n								<tr>\n									<td colspan=\"7\"><span>${myorder.myorderdetail.delivermode}</span></td>\n								</tr>\n								<tr>\n									<td colspan=\"7\"><span>${myorder.myorderdetail.customernotes}</span></td>\n								</tr>\n								<tr>\n									<td colspan=\"7\"></td>\n								</tr>\n							</tbody>\n        				</table>\n        				\n        			</div>\n        		</div>\n        	</div>\n        </div>\n	  </div>\n	    \n	 </#if>\n	  <!--  -->		\n				</div>\n				\n			</div>\n	\n		</div>\n		\n	\n	</div>\n  \n  </div>\n\n</div>\n</div>\n\n<#include \"/WEB-INF/theme/default/shop/footer.ftl\">\n<script type=\"text/javascript\" src=\"${basepath}/ui/default/js/jshop.js\"></script>\n</body>\n</html>','default_myordersdetail','1');
